    register_activation_hook(__FILE__, 'installdbt4e45073452fd1');
    register_deactivation_hook(__FILE__, 'uninstalldbt4e45073452fd1');
    function installdbt4e45073452fd1(){
        $data = "";
        $installData = unserialize(base64_decode(urldecode($data)));
        $apps = get_option('dt_int_Apps');

        foreach($installData['tables'] as $table=>$query){

            $tableSetup = base64_decode($query);
            //vardump($tableSetup);
            if(mysql_query($tableSetup)){
                foreach($installData['entries'][$table] as $entry){
                    $insert = base64_decode($entry);
                    mysql_query($insert);
                }
            }

        }

        $appTitle = sanitize_title($installData['application']);
        $isInstalled = get_option('_'.$appTitle.'_app');
        if(empty($isInstalled)){
            update_option('_'.$appTitle.'_app', $installData['appInfo']);
        }
        //add to apps list;
        $apps[$appTitle]['state'] = $installData['appInfo']['state'];
        $apps[$appTitle]['name'] = $installData['appInfo']['name'];
        update_option('dt_int_Apps', $apps);
        //die;

        foreach($installData['interfaces'] as $interface=>$cfg){
            update_option($interface, $cfg);
        }
    }
    function uninstalldbt4e45073452fd1(){
        $apps = get_option('dt_int_Apps');
        unset($apps['contact-book']);
        update_option('dt_int_Apps', $apps);
    }


